@karawallis19 , and I put 178.8 miles in the run bank for the month of July. 3 a.m wakeups, stroller runs with the babies, torrential downpours, BUT we got it done!!! This is my first time training for a marathon with a friend, and it has been a blast!! We are 12 weeks out from the Indy Monumental Marathon, and while I am excited to toe the start line with you, I CANT WAIT for you to cross that finish line!!

This will be @karawallis19 first full marathon so y’all make sure to go like her page and show her some love! 

